def holder = groovyUtils.getXmlHolder("findDocumentsByTag#response")

def IDs = holder.getNodeValues("//id")

// Récupération de l'ID de référence
def refID = testRunner.testCase.testSuite.getPropertyValue("docID_Sui")


def IDpresent = false
// Assert :
IDs.each { ID ->
	if (ID == refID) {
		IDpresent = true
	}
}
assert IDpresent

def genPrevWeekDate = String.format('%tF', new Date() - 7)
testRunner.testCase.setPropertyValue("genPrevWeekDate", genPrevWeekDate) 

def genDate = String.format('%tF', new Date())
testRunner.testCase.setPropertyValue("genDate", genDate)
